import styled from 'styled-components'

const Outer = styled.div`
    font-family: 'Overpass Mono', monospace , sans-serif;

    p {
        font-size: 18px;
    }

    .dropdown {
        button{
            margin-top: 25px;
        }
    }

    .showKata{
        margin-top: 20%;
    }
`

export default Outer
